import React from 'react';

import item1 from "../img/item-1.png";
import item2 from "../img/item-2.png";
import item3 from "../img/item-1.png";
import item4 from "../img/item-1.png";

class Product extends React.Component {
    render() {
        return (
            <div className='card-itemgrid'>
                <div className='card-img-itemgrid'>
                    <img src={ this.props.image } alt="product img"/>
                </div>
                <div className='card-text-itemgrid'>
                    <span className='product name'>
                        spreadsheets shirt
                    </span>
                    <span className='product price'>
                        $24
                    </span>
                </div>
            </div>
        );
    }
}

export default Product;

